import React, { Component } from 'react';


import Header from '../../Header';
import Resident from '../ResidentForm';
import NextOfKin from '../../NextOfKin/NextOfKin';
import DoctorDetails from '../../Doctor/DoctorDetails';
import NurseDetails from '../../Nurse/NurseDetails';

import CPResidentName from './CPcomponents/CPResidentName';


class CarePlan1 extends Component {
  render() {
    return (
      <div className="container" margin="10px">
        <Header/>
        <div className="container" margin="10px">
          <CPResidentName/>
        </div>
        <hr/>
        <div className="container" margin="10px">
        <NextOfKin/>
        </div>
        <hr/>
        <div className="container" margin="10px">
        <DoctorDetails className="container"/>
        </div>
        <hr/>
        <div className="container" margin="10px">
        <NurseDetails className="container"/>
        </div>

      </div>
    );
  }
}

export default CarePlan1;
